int find_bitmap11()
{
	bool _break = false;
	int counter = 0;
	int actual_number = -1;

	for ( int i = 0; i < 56; ++i )
	{
		for ( int j = 0; j < szerokosc1; ++j )
		{
			for ( int k = 0; k < wysokosc1; ++k )
			{
				if ( actual_bitmap11->pixel[k][j].blue11 != data11[i].pixel[k][j].blue11 || 

actual_bitmap11->pixel[k][j].green11 != data11[i].pixel[k][j].green11 || actual_bitmap11->pixel[k][j].red11 != 

data11[i].pixel[k][j].red11 ) 
				{
					//std::cout << "Bitmapy sa nierowne" << std::endl;
					_break = true;
					counter = 0;
					break;
				}
				else
				{
					++counter;
				}
				
				if ( counter == wysokosc1*szerokosc1 )
				{
					std::cout << "Bitmapy sa sobie rowne" << std::endl;
					actual_number = i;
					std::cout << actual_number << " " << std::endl;
					_break = true;
					counter = 0;
					break;
				}
				
			}
			if ( _break == true )
			{
				_break = false;
				break;
			}	
		}
		if ( actual_number != -1 )
			break;
	}
	return actual_number;
}
