//////////////////////////////////////////////////////////////////////////////////////////////////////
void zamiana_As_11_na_As_1(fstream& plik,int &aktualna_karta_do_gry,int &karta_nr1_,int &karta_nr2_,int &karta_nr3_,int &karta_nr4_)
{
	if((karta_nr1_+karta_nr2_+karta_nr3_+karta_nr4_+aktualna_karta_do_gry)>21&&aktualna_karta_do_gry!=75)
	{
		if(aktualna_karta_do_gry==11){aktualna_karta_do_gry=1;}
		else if(karta_nr4_==11){karta_nr4_=1;}
		else if(karta_nr3_==11){karta_nr3_=1;}
		else if(karta_nr2_==11){karta_nr2_=1;}
		else if(karta_nr1_==11){karta_nr1_=1;}
	}
}
//////////////////////////////////////////////////////////////////////////////////////////////////////
int ustawienie_flagi(fstream& plik,int flaga,int y1_karta_nr1_,int y2_karta_nr1_,int y_karta_nr1_,int y_karta_nr2_,int y_karta_nr3_,int y_karta_nr4_,int y_karta_nr5_)
{
	if(y1_karta_nr1_==11&&y2_karta_nr1_==11&&flaga==2)
	{
		if(y_karta_nr1_==75){y_karta_nr1_=1;}
		if(y_karta_nr2_==75){y_karta_nr2_=1;}
		if(y_karta_nr3_==75){y_karta_nr3_=1;}
		if(y_karta_nr4_==75){y_karta_nr4_=1;}
		if(y_karta_nr5_==75){y_karta_nr5_=1;}
		if(y_karta_nr1_+y_karta_nr2_+y_karta_nr3_+y_karta_nr4_+y_karta_nr5_>21)
		{
		flaga=1;
		}
	}
	return flaga;
}
//////////////////////////////////////////////////////////////////////////////////////////////////////
int ustawienie_flagi2(fstream& plik,int flaga,int &k,int &y1_karta_nr1_,int aktualna_karta_do_gry,int y_karta_nr1_,int y_karta_nr2_,int y_karta_nr3_,int y_karta_nr4_,int y_karta_nr5_)
{
	if(flaga==1)
	{
	flaga=0;
	k=0;
	y1_karta_nr1_=1;//zamiana As=11 na As=1
	if(aktualna_karta_do_gry!=75&&(y_karta_nr1_+y_karta_nr2_+y_karta_nr3_+y_karta_nr4_+y_karta_nr5_>21))
	{
	cout<<"  flaga_A==1 oraz--> niedozwolona wartosc >21 ="<<(y_karta_nr1_+y_karta_nr2_+y_karta_nr3_+y_karta_nr4_+y_karta_nr5_)<<" aktualna_karta_do_gry="<<aktualna_karta_do_gry<<endl;
	Sleep(1500);
	system("pause");
	}
	}
	return flaga;
}
